INSERT INTO `cursocontabilidade` (`objetivoCurso`, `criteriosAvaliacao`, `estagio`, `perfilConclusao`, `gradeCurricular`) VALUES
('<p style=\"text-align: left;\"><span style=\"font-size: 1rem;\">O Curso Técnico em Contabilidade objetiva desenvolver no aluno a excelência contábil, de maneira ética e organizada, transformando as informações em conhecimentos técnicos e operacionais inerentes à área de gestão e negócios.&nbsp;</span></p>', '<p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A avaliação considerada como processo de construção do conhecimento combina procedimentos de avaliação de competências que se realiza de forma contínua, envolvendo teoria e prática.</span><br></p><p style=\"text-align: left; \"><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">O resultado é expresso pelos pareceres&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">&nbsp;e&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Não Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">Quando o aluno, após as atividades de recuperação desenvolvidas durante o processo for considerado Não Apto, a escola oferece uma nova oportunidade, sendo retomados os conteúdos mínimos que propiciem aquisição de conhecimentos básicos para promoção da etapa seguinte: os estudos adicionais. No período de estudos adicionais, são retomadas as competências significativas para a promoção do aluno.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A Escola exige do aluno o percentual de 75% de frequência nas atividades curriculares, conforme legislação vigente, oferecendo-lhe atividades compensatórias e presencias de infrequência.</span><br></p>', '', '<p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">O Técnico em Contabilidade deve ser um profissional capaz de desenvolver a excelência contábil, transformando as informações em conhecimentos técnicos e operacionais inerentes à área de gestão e negócios, bem como elaborar e avaliar projetos de empreendedorismos (Plano de negócios). Deve ser autogerenciador de seus serviços, adaptando-se às novas tecnologias, buscando o aperfeiçoamento técnico permanentemente. Ter iniciativa, criatividade, espírito empreendedor e ético para exercer a cidadania, contribuindo para a prática de gestão social.</span><br></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">O Técnico em Contabilidade terá como competências:</span><br></p><ul><li style=\"text-align: justify; \">Fazer a escrituração contábil de acordo com os princípios da ética contábil, demonstrando o patrimônio das entidades econômico-administrativas das empresas comerciais e industriais nos seus aspectos financeiros e humanos</li><li style=\"text-align: justify;\">Promover a gestão de empreendimentos inovadores, utilizando sistemas gerenciais e legais que privilegiem as normas técnicas e de segurança e os princípios de proteção ambiental.</li><li style=\"text-align: justify;\">Realizar atividades de prática profissional relativas à contabilidade, aplicando a metodologia cientifica</li><li style=\"text-align: justify;\">Conhecer, aplicar e calcular as rotinas próprias inerentes aos recursos humanos</li><li style=\"text-align: justify;\">Analisar os dados concretos, aplicando fórmulas e interpretando os resultados obtidos para a tomada de decisão em uma entidade sócio-econômico-administrativo</li><li style=\"text-align: justify;\">Conhecer os conceitos e legislação básica do direito utilizados na profissão contábil</li><li style=\"text-align: justify;\">Identificar os riscos ocupacionais no ambiente de trabalho</li><li style=\"text-align: justify;\">Operacionalizar e pesquisar utilizando os softwares contábeis e seus aplicativos em pesquisa na prática contábil</li><li style=\"text-align: justify;\">Identificar os riscos ocupacionais no ambiente de trabalho</li><li style=\"text-align: justify;\">Operacionalizar e pesquisar utilizando os softwares contábeis e seus aplicativos em pesquisa na prática contábil</li><li style=\"text-align: justify;\">Reconhecer os usuários da análise de balanço e a sua utilidade para a entidade empresarial em sua gestão</li><li style=\"text-align: justify;\">Verificar a veracidade das demonstrações contábeis</li><li style=\"text-align: justify;\">Fazer exame minucioso das demonstrações contábeis</li><li style=\"text-align: justify;\">Aplicar os princípios contábeis nos relatórios contábeis</li><li style=\"text-align: justify;\">Elaborar balanço patrimonial e D.R.E</li><li style=\"text-align: justify; \">Calcular os índices socioeconômicos da entidade.</li></ul>', '<p style=\"text-align: justify; \">O curso est&aacute; organizado em <strong>3 semestres</strong>. A organiza&ccedil;&atilde;o curricular segue as condi&ccedil;&otilde;es necess&aacute;rias &agrave; integra&ccedil;&atilde;o entre os componentes curriculares, organiza&ccedil;&atilde;o e sequencia, de acordo com o perfil tra&ccedil;ado, visando garantir as condi&ccedil;&otilde;es de empregabilidade e laboralidade ao aluno concluente.</p><p style=\"text-align: justify;\">O curso tem dura&ccedil;&atilde;o de <strong>1080 horas</strong>.</p><table border=\"1\" class=\"table table-bordered\" style=\"text-align: center;\"><tbody><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>1&ordm; SEMESTRE</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>2&ordm; SEMESTRE</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>3&ordm; SEMESTRE</h5></td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">160h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE GERAL*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">160h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE COMERCIAL*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">60h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE INDUSTRIAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><p>DIREITO E LEGISLA&Ccedil;&Atilde;O*</p></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE P&Uacute;BLICA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLA&Ccedil;&Atilde;O</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZA&Ccedil;&Atilde;O E T&Eacute;CNICAS COMERCIAIS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLA&Ccedil;&Atilde;O</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZA&Ccedil;&Atilde;O E T&Eacute;CNICAS COMERCIAIS<br></td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTAT&Iacute;STICA APLICADA A CONTABILIDADE *</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZA&Ccedil;&Atilde;O E T&Eacute;CNICAS COMERCIAIS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">PORTUGU&Ecirc;S INSTRUMENTAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">MATEM&Aacute;TICA FINANCEIRA *</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTAT&Iacute;STICA APLICADA A CONTABILIDADE<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORM&Aacute;TICA APLICADA A CONTABILIDADE</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">MATEM&Aacute;TICA FINANCEIRA<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ANALISES DE BALAN&Ccedil;OS</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INGL&Ecirc;S INSTRUMENTAL</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORM&Aacute;TICA APLICADA A CONTABILIDADE<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">GEST&Atilde;O P&Uacute;BLICA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">&Eacute;TICA E RELA&Ccedil;&Otilde;ES HUMANAS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ECONOMIA E MERCADO</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">GEST&Atilde;O EMPRESARIAL</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">SEGURAN&Ccedil;A DO TRABALHO</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">EMPREENDEDORISMO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ECONOMIA E MERCADO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">120h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">PR&Aacute;TICA SUPERVISIONADA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORIENTA&Ccedil;&Atilde;O DE PR&Aacute;TICA SUPERVISIONADA</td></tr></tbody></table><p style=\"text-align: justify;\"><span style=\"font-size: 12px;\"><em>* Pr&eacute;-requisito para o semestre seguinte</em></span></p>');

