INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(113, 'Processo Seletivo Cursos Técnicos 2019/02', '<p style=\"text-align: center;\"><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 14px;\">Interessado em se inscrever nos cursos t&eacute;cnicos da Escola Estadual de Ensino M&eacute;dio Professora Maria Rocha?&nbsp;</span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\">Pois saiba que as inscri&ccedil;&otilde;es est&atilde;o abertas! Venha fazer parte da nossa hist&oacute;ria!&nbsp;</span></span></p><p style=\"text-align: center;\"><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 14px;\">Inscreva-se <a href=\"http://servicos.educacao.rs.gov.br/pse/srv/matricula.jsp?ACAO=acao5\" target=\"_blank\">AQUI</a>!</span></p>', 'pippi', 1, '29/06/2019 14:57:24');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(114, 'Inauguração da nova quadra esportiva', '<p><span style=\"font-family: Helvetica; font-size: 14px;\">A escola inaugurou no dia 01 de Julho de 2019 a nova quadra esportiva.</span><span style=\"font-size: 14px;\"><span style=\"font-family: Helvetica;\">&nbsp;Agora alunos poder&atilde;o desfrutar da nova quadra no per&iacute;odo&nbsp;</span></span><span style=\"font-size: 14px; font-family: Helvetica;\">do recreio.</span></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"02.jpg\" style=\"width: 50%;\" class=\"fr-fic fr-dii\"><span style=\"font-size: 18px; font-family: Helvetica;\"><br></span></p>', 'pippi', 1, '29/06/2019 15:07:44');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(115, 'Editar - Processo Seletivo 2019/02', '<p><span style=\"font-size: 18px;\">Está disponível o editar referente ao Processo seletivo de 2019/02. Visualize o editar, </span><a href=\"https://bit.ly/2wPIrK0\" target=\"_blank\"><span style=\"font-size: 18px; font-family: Helvetica;\">clicando aqui!</span></a></p><p><span style=\"font-size: 18px; font-family: Helvetica;\">No editar estará especificado tudo que você precisa saber sobre a prova.</span></p>', 'pippi', 0, '29/06/2019 15:10:42'),
(116, 'Editar - Licitação para o Bar da escola', '<p><span style=\"font-family: Helvetica;\">Est&aacute; aberto a licita&ccedil;&atilde;o para o bar da escola. Atrav&eacute;s do link dispon&iacute;vel abaixo, voc&ecirc; conseguir&aacute; todas as informa&ccedil;&otilde;es para submeter sua empresa a licita&ccedil;&atilde;o.</span></p><p><span style=\"font-family: Helvetica; font-size: 14px;\">Visualize o editar,&nbsp;</span><a href=\"http://bit.ly/2VEkuiN\" target=\"_blank\"><span style=\"font-family: Helvetica; font-size: 14px;\">clicando aqui!</span></a></p>', 'pippi', 0, '29/06/2019 15:12:33'),
(117, 'Abertura da licitação para o bar da escola', '<p><span style=\"font-family: Helvetica;\">Abriu a licitação para candidaturas de empresas para se responsabilizar pelo bar da escola. Vá até a aba Editais para conseguir acesso ao Edital</span></p><p><br></p>', 'pippi', 1, '29/06/2019 15:22:31');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(118, 'Classificados Informática - 2019/01', '<p style=\"text-align: left;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"hRHyuPQ.jpg\" style=\"width: 517px; height: 728.454px;\" class=\"fr-fic fr-dii\"><img src=\"data:image/jpeg;base64,\" data-filename=\"rRAKYIB.jpg\" style=\"width: 517px; height: 730.985px;\" class=\"fr-fic fr-dii\"></p><p style=\"text-align: justify;\"><br></p>', 'pippi', 0, '29/06/2019 15:35:37');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(119, 'Classificados Contabilidade (Noturno) - 2019/01', '<p><img src=\"https://imgur.com/9D7vuVG.jpg\" style=\"width: 508px; height: 716.41px;\" class=\"fr-fic fr-dii\"><img src=\"https://imgur.com/gIc3v72.jpg\" style=\"width: 512px; height: 722.597px;\" class=\"fr-fic fr-dii\"></p><p><img src=\"https://imgur.com/Ytue8bY.jpg\" style=\"width: 523px; height: 738.416px;\" class=\"fr-fic fr-dii\"></p><p><br></p>', 'pippi', 0, '29/06/2019 15:43:28'),
(120, 'Divulgação da lista de classificados nos Cursos Técnicos - 2019/01', '<p><span style=\"font-family: Helvetica; font-size: 18px;\">Saiu a lista de classificados dos Cursos Técnicos em Informática Noturno, Contabilidade Noturno e Diurno.</span></p><p><span style=\"font-family: Helvetica; font-size: 18px;\">Corre na aba Editais e confira sua classificação.</span></p><p><br></p>', 'pippi', 1, '29/06/2019 15:49:55'),
(121, 'Classificados Contabilidade (Diurno) - 2019/01', '<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/BqH2RzT.jpg\" style=\"width: 503.828px; height: 602px;\" class=\"img-fluid fr-fic fr-dii\"><br></p>', 'pippi', 0, '29/06/2019 15:54:34'),
(122, 'Gabarito das provas dos Cursos Técnicos - 2019/01', '<p style=\"text-align: justify;\"><br></p>', 'pippi', 1, '29/06/2019 16:00:49'),
(123, 'Saiba a história de sua escola', '<p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif; text-align: center; font-size: 14px;\">A Escola Maria Rocha nasceu dentro do atual Instituto de Educa&ccedil;&atilde;o Olavo Bilac. Em 1941, foi criado o Curso Ginasial</span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif; text-align: center;\">&nbsp;(1&ordm; Ciclo&nbsp;</span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">do</span></span><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">&nbsp;Curso Secund&aacute;rio) na</span></span></span></span></p><br><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Escola Normal&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Olavo Bilac. Este curso foi desanexado desta Escola em 08 de fevereiro de 1957.&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Em 1958,&nbsp;</span></span><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">o Gin&aacute;sio passa a denominar-se Gin&aacute;sio&nbsp;</span></span></span></span></p><br><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Estadual Caetano Pagliuca. Em&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">1962,&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">com a cria&ccedil;&atilde;o de 2&ordm; Ciclo do Secund&aacute;rio (atual&nbsp;</span></span><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Ensino M&eacute;dio), a Escola passa a&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">denominar-se Col&eacute;gio Estadual&nbsp;</span></span></span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Caetano Pagliuca.&nbsp;</span></span><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Em 21 de janeiro de 1963, ap&oacute;s&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">intensa mobiliza&ccedil;&atilde;o dos professores e funcion&aacute;rios, finalmente, recebe a denomina&ccedil;&atilde;o&nbsp;</span></span></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">de&nbsp;</span></span></span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"text-align: center;\">Col&eacute;gio&nbsp;</span></span></span><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif; text-align: center;\">Estadual Professora Maria Rocha - atualmente Escola de Ensino M&eacute;dio&nbsp;</span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif; text-align: center;\">PROF.&ordf; Maria Rocha.</span></span></p><br><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><img src=\"http://www.mariarocha.org.br/fotos/5.jpg\" style=\"width: 353.271px; height: 264.953px;\" class=\"img-fluid fr-fic fr-dii\"> <img src=\"http://www.mariarocha.org.br/fotos/6.jpg\" style=\"width: 356.562px; height: 267.422px;\" class=\"fr-fic fr-dii\"><span style=\"color: rgb(33, 37, 41); font-family: Helvetica; text-align: center;\"><br></span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"color: rgb(33, 37, 41); font-family: Verdana, Geneva, sans-serif; text-align: center;\">A professora que da nome a escola se chama&nbsp;</span><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">Maria Manoela Rocha nasceu em 23 de dezembro de 1904. Em 1926, concluiu os&nbsp;</span></span></span><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">estudos na Escola&nbsp;</span></span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">Complementar em&nbsp;</span></span></span><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">Porto Alegre, tornando-se professora. Passou a lecionar no Col&eacute;gio Elementar Farroupilha,&nbsp;</span></span></span><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">atual Instituto de Educa&ccedil;&atilde;o Olavo&nbsp;</span></span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana,Geneva,sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">Bilac.&nbsp;</span></span><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif;\">Foi professora dedicada por 32 anos.&nbsp;</span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, sans-serif;\">V&iacute;tima de c&acirc;ncer, faleceu em 1&ordm; de outubro de 1958.</span></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><img src=\"http://localhost/MariaRocha/img/profMariaRocha.jpg\" style=\"width: 25%;\" class=\"img-fluid fr-fic fr-dii\"><br></span></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><span style=\"font-family: Verdana, Geneva, sans-serif; color: rgb(0, 0, 0);\">Maria Manoela Rocha deixou um grande legado para n&oacute;s que levamos entre at&eacute; hoje....</span></span></p>', 'pippi', 1, '29/06/2019 16:08:41'),
(124, 'Aula inaugural para o curso Técnico em Informática', '<p><span style=\"font-family: Helvetica;\">Aguardamos todos para a aula inaugural do T&eacute;cnico em Inform&aacute;tica.</span></p>', 'teste', 1, '29/06/2019 17:22:42'),
(125, 'Manutenção nos laboratórios', '<p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 14px;\">Foi realizada a manuten&ccedil;&atilde;o preventiva nos computadores dos laborat&oacute;rios de inform&aacute;tica. Esta manuten&ccedil;&atilde;o foi realizada pelos&nbsp;</span><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 14px;\">alunos do terceiro&nbsp;</span></p><p><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 14px;\">semestre do curso t&eacute;cnico com a supervis&atilde;o do professor Natanael. Est&aacute; manuten&ccedil;&atilde;o &eacute; necess&aacute;ria....</span></p><p style=\"text-align: center;\"><span style=\"font-family: Verdana, Geneva, sans-serif; font-size: 18px;\"><img src=\"http://www.mariarocha.org.br/fotos/9.jpg\" style=\"width: 409.629px; height: 306.096px;\" class=\"fr-fic fr-dii\">&nbsp;</span></p>', 'guiselair', 1, '29/06/2019 17:35:36');

